using System;\n\nclass MyClass\n{\n    public void MyMethod()\n    {\n        // Method implementation\n    }\n}\n\nclass Program\n{\n    static void Main()\n    {\n        MyClass obj = new MyClass();\n        // Initial calls to MyMethod will be interpreted\n        obj.MyMethod();\n        obj.MyMethod();\n        // After several calls, the CLR may decide to JIT compile MyMethod\n        obj.MyMethod();\n    }\n}